/*Table structure for table `entrance_logs` */

DROP TABLE IF EXISTS `entrance_logs`;

CREATE TABLE `entrance_logs` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `registered_borrower_id` int(11) DEFAULT NULL,
  `transdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `type` enum('Bisu','Congressional') DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

