/* Procedure structure for procedure `sp_books_add` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_add` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_add`(
	_title varchar (255),
	_author varchar (255),
	_place_and_publisher varchar(255),
	_section varchar (50),
	_call_no varchar (255),
	_account_no varchar (255),
	_no_of_copies int (11),
	_edition varchar (50),
	_cost_price float (12,2),
	_copyright_year year,
	_type varchar (50)
    )
BEGIN
	INSERT INTO `books` (`title`,`author`,`place_and_publisher`,`section`,`call_no`,`account_no`,`no_of_copies`,`edition`,`cost_price`,`copyright_year`,`type`)
	VALUES (_title, _author, _place_and_publisher,_section,_call_no,_account_no,_no_of_copies,_edition,_cost_price,_copyright_year,_type);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_books_edit` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_edit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_edit`(
	_title VARCHAR (255),
	_author VARCHAR (255),
	_place_and_publisher VARCHAR(255),
	_section VARCHAR (50),
	_call_no VARCHAR (255),
	_account_no VARCHAR (255),
	_no_of_copies INT (11),
	_edition VARCHAR (50),
	_cost_price FLOAT (12,2),
	_copyright_year YEAR,
	_edit_id int (11)
    )
BEGIN
	UPDATE books SET `section` =_section, `call_no`=_call_no, `account_no`=_account_no, `no_of_copies`=_no_of_copies, `author`=_author, `title`=_title, 
	`place_and_publisher`=_place_and_publisher,`edition`=_edition, `cost_price`=_cost_price, `copyright_year`=_copyright_year WHERE
	id = _edit_id;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_books_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_get`(
	_type varchar (255)
)
BEGIN
	SELECT * FROM `books` b WHERE b.`type` = _type;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_books_search` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_books_search` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_books_search`(
	_title varchar (255)
    )
BEGIN
	SELECT * FROM `books` b WHERE b.`title` LIKE CONCAT('%',_title,'%');
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_book_borrow_barcode_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_book_borrow_barcode_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_book_borrow_barcode_get`(
	_barcode varchar (50)
    )
BEGIN
	SELECT CONCAT(rb.`last_name`, ", ",rb.`first_name`, " ", UPPER(SUBSTRING(rb.`middle_name`,1,1)),".") AS `name`,b.`title`,b.`author`,bb.`barcode` FROM `book_borrow` bb 
	JOIN `books` b ON b.id = bb.`book_id`
	JOIN `registered_borrowers` rb ON rb.`id` = bb.`borrower_id`
	WHERE bb.`barcode` = _barcode;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_book_borrow_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_book_borrow_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_book_borrow_get`(
	_type VARCHAR (50),
	_date_from datetime,
	_date_to datetime
)
BEGIN
	SELECT b.`title`,b.`author`,CONCAT(rb.`last_name`, ", ",rb.`first_name`, " ", UPPER(SUBSTRING(rb.`middle_name`,1,1)),".") AS `borrower`,
	bb.`barcode`,DATE_FORMAT(bb.`borrow_date`, "%M %d, %Y %h:%i %p") AS borrowed_on,DATE_FORMAT(bb.`return_date`,"%M %d, %Y %h:%i %p") AS returned_on, bb.borrower_id FROM `book_borrow` bb 
	JOIN `books` b ON b.`id` = bb.`book_id`
	JOIN `registered_borrowers` rb ON rb.`id` = bb.`borrower_id`
	WHERE rb.`type` = _type AND date(bb.`borrow_date`) BETWEEN date(_date_from) AND date(_date_to);
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_book_deac` */

