/* Procedure structure for procedure `sp_entrance_logs_get` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_entrance_logs_get` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_entrance_logs_get`(
	_date_from DATETIME,
	_date_to DATETIME
)
BEGIN
	SELECT el.*, DATE_FORMAT(DATE(el.transdate),"%M, %d %Y") AS `date`, TIME_FORMAT(TIME(el.transdate),"%h:%i %p") AS `time`,
	CONCAT(rb.`last_name`, ", ",rb.`first_name`, " ", UPPER(SUBSTRING(rb.`middle_name`,1,1)),".") AS `name`, CONCAT(rb.`year`,rb.`section`) AS year_and_section, rb.`course`,rb.`sex` FROM `entrance_logs` el
	JOIN `registered_borrowers` rb ON rb.`id` = el.`registered_borrower_id` where date(el.transdate) between date(_date_from) AND date(_date_to);
    END */$$
DELIMITER ;

