/*!50003 CREATE DEFINER=`system_admin`@`%` PROCEDURE `sp_registered_borrowers_edit`(
	_contact_number VARCHAR (20),
	_first_name VARCHAR (255),
	_middle_name VARCHAR (50),
	_last_name VARCHAR (255),
	_sex VARCHAR (25),
	_course VARCHAR (50),
	_year VARCHAR (25),
	_section VARCHAR (50),
	_image LONGBLOB,
	_edit_id int (11)
    )
BEGIN
